/**
  * @brief  The application entry point.
  * @retval int
  */
int main(void)
{
  /* USER CODE BEGIN 1 */
  int16_t triangleCornersX[3] = {-5, 0, 5};
  int16_t triangleCornersY[3] = {5, -5, 5};
  uint8_t i = 0U;
  int16_t j;

  /* USER CODE END 1 */
  

  /* MCU Configuration--------------------------------------------------------*/

  /* Reset of all peripherals, Initializes the Flash interface and the Systick. */
  HAL_Init();

  /* USER CODE BEGIN Init */

  /* USER CODE END Init */

  /* Configure the system clock */
  SystemClock_Config();

  /* USER CODE BEGIN SysInit */

  /* USER CODE END SysInit */

  /* Initialize all configured peripherals */
  MX_GPIO_Init();
  MX_DMA_Init();
  MX_SPI1_Init();
  /* USER CODE BEGIN 2 */

  SPI_1LINE_TX(&hspi1);
  GraphicsInit();

  /* USER CODE END 2 */

  /* Infinite loop */
  /* USER CODE BEGIN WHILE */
  while (1)
  {
    /* USER CODE END WHILE */

    /* USER CODE BEGIN 3 */
	i++;
	if (i == 13U)
	{
		memcpy(triangleCornersX, triangleCornersXOrig, sizeof(triangleCornersX));
		memcpy(triangleCornersY, triangleCornersYOrig, sizeof(triangleCornersY));
		i = 0U;
	}

	GraphicsClear(RED);
	HAL_Delay(200UL);

	GraphicsClear(GREEN);
	HAL_Delay(200UL);

	GraphicsClear(BLUE);
	HAL_Delay(200UL);

	GraphicsClear(BLACK);
	GraphicsVline(10, 20, 400, WHITE);
	GraphicsHline(0U, ST7789_LCD_WIDTH, 50, YELLOW);
	GraphicsRectangle(50, 50, 100, 50, GREEN);
	GraphicsString(50, 200, "Freddy", PINK);
	GraphicsStringVert(50, 100, "Freddy", CYAN);
	GraphicsLine(150, 160, 170, 180, RED);
	GraphicsLine(180, 170, 160, 150, BLUE);
	GraphicsCircle(120, 210, 22, ORANGE);
	HAL_Delay(500UL);

	GraphicsClear(BLACK);
	GraphicsMonochromeBitmap(0, 0, 128, 64, BLUE, YELLOW, pic);
	GraphicsFilledCircle(200, 200, 20, PURPLE);
	HAL_Delay(500UL);

	GraphicsClear(BLACK);
	for (j = 0; j < 105; j++)
	{
		GraphicsColourBitmap(j, j, 101, 135, kitten);
		GraphicsVline(j - 1, 0, ST7789_LCD_HEIGHT, BLACK);
		GraphicsHline(0, ST7789_LCD_WIDTH, j - 1, BLACK);
	}

	GraphicsClear(BLACK);
	GraphicsScaleShape(3U, triangleCornersX, triangleCornersY, 15, 13);
	GraphicsRotateShape(3U, triangleCornersX, triangleCornersY, 45);
	GraphicsDrawShape(3U, triangleCornersX, triangleCornersY, 50, 50, YELLOW);
	GraphicsDrawFilledShape(3U, triangleCornersX, triangleCornersY, 50, 100, BLUE);
	GraphicsArc(120, 160, 30, 45, 270, RED);
	GraphicsSegment(50, 180, 30, -90, 179, WHITE);
	GraphicsFilledSegment(100, 50, 30, 180, -90, 20U, WHITE);
	HAL_Delay(500UL);

	GraphicsClear(BLACK);
	GraphicsRoundedRectangle(20, 20, 150U, 50U, 15, PINK);
	HAL_Delay(500UL);
  }
  /* USER CODE END 3 */
}

